window.bookSummaryJSON = "<p>My name is Vinna and I am a Sentinel. </p> <p>I'm the last in a line of a hunted, magical race, coveted and killed for our power and abilities. I was hidden and protected, but now that I've been found, it's a race to see who can command and control me. </p> <p>Joke's on them, I bow to no one. </p> <p>I need to master my magic, and protect the five guys I've marked as my own at all costs. Because the line between friend and foe is dangerously blurry, and I'm collecting enemies like Sentinels collect runes. </p> <p>It's time to prepare for battle, claim my place, and get ready to fuck up anything or anyone that comes for me and my Chosen. </p> <p>Contains mature themes.</p>"; 
